import React from "react";

interface ButtonProps {
  onClick: () => void;
  label: string;
}

const Button: React.FC<{ onClick: () => void; label: string }> = (props) =>{
    return <button onClick={props.onClick}>{props.label}</button>;
}

export default Button;
